INSERT INTO `financial_indicator_library_indicator` VALUES (1,'净资产收益率','return_on_equity','roe','%','净利润与平均股东权益的百分比，是公司税后利润除以净资产得到的百分比率',1),(2,'总资产报酬率','return_on_total_assets','rota','%','企业投资报酬与投资总额之间的比率。企业的投资报酬是指支付利息和缴纳所得税之前的利润之和，投资总额为当期平均资产总额',1),(3,'销售（营业）利润率','return_on_sales','ros','%','售利润率是企业利润与销售额之间的比率;营业利润/全部业务收入×100%',1),(4,'盈余现金保障倍数','surplus_cash_security_multiple','scsm','','又叫利润现金保障倍数，是指企业一定时期经营现金净流量同净利润的比值',1),(5,'成本费用利润率','ratio_of_profits_to_cost_and_expenses','rpce','%','（利润总额÷成本费用总额）×100%，其中：成本费用总额包括：主营业务成本、主营业务税金及附加、营业费用、管理费用、财务费用。如果能够获得其他业务支出数据的，还应当包括其他业务支出数据。',1),(6,'资本收益率','return_on_capital','roc','%','企业净利润（即税后利润）与平均资本（即资本性投入及其资本溢价）的比率',1),(7,'总资产周转率','total_assets_turnover ','tat','次','企业一定时期的销售收入净额与平均资产总额之比',2),(8,'应收账款周转率','accounts_receivable_turnover','art','次','企业在一定时期内赊销净收入与平均应收账款余额之比',2),(9,'不良资产比率','bad_asset_ratio','bar','%','不良资产占全部资产的比率。企业的不良资产是指企业尚未处理的资产净损失和潜亏(资金)挂帐,以及按财务会计制度规定应提未提资产减值准备的各类有问题资产预计损失金额',2),(10,'流动资产周转率','current_asset_turnover','cat','次','企业一定时期内主营业务收入净额同平均流动资产总额的比率',2),(11,'资产现金回收率','cash_recovery_of_assets','cra','%','经营现金净流量与全部资产的比率',2),(12,'资产负债率','asset_liability_ratio','alr','%','期末负债总额除以资产总额的百分比',3),(13,'已获利息倍数','number_of_times_interest_earned','ntie','','息税前利润相对于所需支付债务利息的倍数',3),(14,'速动比率','quick_ratio','qr','%','企业速动资产与流动负债的比率',3),(15,'现金流动负债比率','cash_flows_coverage_ratio','cfcr','%','企业一定时期的经营现金净流量同流动负债的比率',3),(16,'带息负债比率','interest_bearing_debt_ratio','ibdr','%','企业某一时点的带息负债总额与负债总额的比率',3),(17,'或有负债比率','contingent_liability_ratio','clr','%','企业或有负债总额与股东权益总额的比率',3),(18,'销售（营业）增长率','sales_growth_rate','sgr','%','企业本年销售收入增长额同上年销售收入总额之比',4),(19,'资本保值增值率','capital_preservation_and_appreciation_rate','cpar','%','期末所有者权益÷期初所有者权益x 100%',4),(20,'销售（营业）利润增长率','operating_profit_growth_rate','opgr','%','企业本年营业利润增长额与上年营业利润总额的比率',4),(21,'总资产增长率','total_asset_growth_rate','tagr','%','企业年末总资产的增长额同年初资产总额之比',4),(22,'技术投入比率','technology_input_ratio','tir','%','企业本年科技支出（包括用于研究开发、技术改造、科技创新等方面的支出）与本年营业收入的比率',4),(23,'存货周转率','inventory_turnover','it','次','企业一定时期销货成本与平均存货余额的比率',5),(24,'两金占流动资产比重','two_gold_accounts_for_the_proportion_of_current_assets','tgapca','%','应收款占用的资金和存货占用的资金与流动资产的比值',5),(25,'成本费用占营业收入比重','cost_and_expenses_as_a_percentage_of_operating_income','cepoi','','(营业成本+营业税金及附加+销售费用+管理费用+财务费用)/营业收入',5),(26,'经济增加值率','economic_value_added_rate','evar','%','等于经济增加值除以所占用的资本总额。',5),(27,'EBITDA率','earnings_before_interest_taxes_depreciation_and_amortization_rate','ebitdar','%','EBITDA与营业收入的比值',5),(28,'资本积累率','capital_accumulation_rate','car','%','年末所有者权益的增长额同年初所有者权益总额之比',5);
